import { Button } from "@mui/material";
import { Box } from "@mui/system";
import React, { PureComponent, useEffect } from "react";
import "./navBar.css";

export default function NavBar(props) {
  const { menuItems, logo, setCurrentRoute } = props;
  let buttons = null;

  const mockMenuItems = [
    { label: "About", url: "about" },
    { label: "Contact", url: "contact" },
    { label: "Projects", url: "projects" },
  ];

  useEffect(() => {
    buttons = document.getElementsByName("button-id");
  });

  function DisplayMenuItems(props) {
    const { menuItems } = props;

    return (
      <React.Fragment>
        {menuItems.map((item, index) => (
          <React.Fragment key={index}>
            <Button id="button-id" onClick={() => setCurrentRoute(item.url)}>
              {item.label}
              {/* <div className="button-hover-bar"></div> */}
            </Button>
          </React.Fragment>
        ))}
      </React.Fragment>
    );
  }

  return (
    <div className="nav-bar-main-div">
      <div className="navBar">
        <DisplayMenuItems menuItems={mockMenuItems} />
      </div>
    </div>
  );
}
